        <Button
        id="toggle-check"
        type="checkbox"
        variant={
        //   checked.toString() === radio.value ? "outline-primary" : "primary"
          "primary" 
        }
        checked={checked}
        className="optionbtn"
        checked={checked.toString() === radio.value ? false : true}
        // name={radio.name}
        // value={radio.value}
         onClick={onClick}
      >{text}</Button>
    )


}

export default Optionbtn
